import * as PropTypes from "prop-types";

export function Button({onClick, children, variant, startIcon}) {
    return null
}


Button.propTypes = {
    onClick: PropTypes.func,
    variant: PropTypes.string,
    startIcon: PropTypes.element,
    children: PropTypes.node
};
